literals:
.bio {
                    marginTop: 5px;
                    padding: 10px !important;
                    color: ${appConfig.theme.colors.neutrals[100]};
                    background-color: ${appConfig.theme.colors.neutrals[999]};
                    border-radius: 15px 5px;
                    margin-top: 5px;
                }
                .bio p {
                    font-size: 9pt;
                }
                .back {
                    position: absolute;
                    width: 100%;
                    height: 100%;
                    background-color: #222222;
                    opacity: 0.4;
                }
                .close {
                    font-size: 8pt;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    color: ${appConfig.theme.colors.neutrals[100]};
                    background-color: ${appConfig.theme.colors.neutrals[999]};
                    border-radius: 50%;
                    width: 20px;
                    height: 20px;
                    cursor: pointer;
                    position: absolute;
                    right: 10px;
                }
